import React from 'react'

export default function Search() {
    return (
        <div className="search">
            <form className="search-box"> 
            <h2>Search</h2>
            <div className="search-specialty"> 
                <input placeholder="Search for a specialty" />
            </div>
            </form>
        </div>
    )
}
